import React from "react";
import './style.scss';

export const Body = () => {
    return(
        <body className="body__container">            
            <div className="body__wrapper">              
                <span className="body__title">
                ⠀Sorocaba Para Todos 
                </span> 
            </div>
            <div className="body__wrapper">              
                <span className="body__content">
                ⠀Nossa missão é facilitar o encontro entre lugares inclusivos e pessoas que buscam alternativas culturais para sair de casa, com a mobilidade que todo cidadão precisa. Checamos 10 itens essenciais de acessibilidade para pessoas com deficiência em diversos pontos da cidade. 
                </span> 
            </div>
        </body>
    )
}
